import { useEffect, useState } from "react";
import { Link } from "react-router-dom";


function Addcart() {
    const [data, setData] = useState([])
    useEffect(() => {
        fetch("http://localhost:3002/cart")
            .then((res) => {
                return res.json()
            })
            .then((resp) => {
                setData(resp)
                console.log(resp)
            })
    },[])


    return (
        <div> <Link to="Main">
        <button className="btn btn-danger">back</button>
    </Link>
        <div style={{ display: "grid", gridTemplateColumns: "auto auto auto auto", gridGap: "5px", marginTop: "10px" }}>
           {data.map((ourdata) => (
                <div>
                    <div className="card" style={{ width: "250px", height: "400px", textAlign: "center", boxShadow: "lightblue 4px 5px 5px 4px" }} >
                        <img src={ourdata.img} alt="k" style={{ width: "220px", height: "200px", borderRadius: "8px", marginLeft: "14px", marginTop: "20px" }} />
                        <h4>{ourdata.name}</h4>
                        <h5>{ourdata.brand}</h5>
                        <h5> <i class="fa-solid fa-indian-rupee-sign"></i> {ourdata.price}</h5>
                  
                    </div>
                </div>
            ))}
     
            
    
        </div>
        </div>
    )

}

export default Addcart;
